import MainPage from "./MainPage";
import { useEffect } from "react";

function Data() {
  useEffect(()=>{
    fetch('/http://localhost:3002/GamoshvebisMult',
    {
        method: "get",
        dataType: 'json',
    })
    .then((res) => res.json())
    .then((data) => {
      console.log(data)
    })
    .catch(err => console.log(err))
  }, [])
  return (
    <div>
      <MainPage />
      <p>
      </p>
    </div>
  );
}
export default Data;
